import './App.css';
import Home from './pages/Home';
import React, { useState } from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Progress from './pages/Progress';
import Leftbar from './component/Leftbar';
import Exeplore from './pages/Exeplore';
import Profile from './pages/Profile';
import PostForm from './component/PostForm';
import { createTheme, ThemeProvider } from '@mui/material/styles'; 
const posts = [
  {
    username: 'user1',
    title: 'Title 1',
    caption: 'Caption 1',
    imageUrl: 'https://car-images.bauersecure.com/wp-images/13349/1056x594/80-mercedes-amg-gt63-e-performance-hero.jpg',
  },
  {
    username: 'user2',
    title: 'Title 2',
    caption: 'Caption 2',
    imageUrl: 'https://via.placeholder.com/500x500',
  },
  // Add more post objects here
];
function App() {
  const theme = createTheme({
    palette: {
      primary: {
        main: '#FFFFFF',
      },
      secondary: {
        main: '#FFFFFF',
      },
    },
  });
  const [posts, setPosts] = useState([]);

  const handlePost = (newPost) => {
    // Update the posts state with the new post
    setPosts([newPost, ...posts]);
  };

  return (
    <ThemeProvider theme={theme}>

    <BrowserRouter className="App">
      <div className="App">

      <Leftbar onPost={handlePost} />
        <Routes>
          <Route path="/Home" element={      <Home posts={posts} />
} />
          <Route path="/prof" element={<Profile/>} />

          <Route path="/prog" element={<Progress />} />
          <Route path="/exp" element={<Exeplore/>} />
          <Route path="/Home/create" element={<PostForm/>} />





        </Routes>
      </div>
    </BrowserRouter>
    </ThemeProvider>
  );
}

export default App;
